import React, { Component } from 'react';
import 'materialize-css';
import Select from 'react-select';

const options = [
  {
    label: "Hiro",
    options: [
      {
        label: "Neutral", value: "sChatNeutral"
      }
    ]
  },
  {
    label: "Jackie",
    options: [
      {
        label: "Neutral", value: "sJackieNeutral"
      }
    ]
  },
  {
    label: "Shorts",
    options: [
      {
        label: "Neutral", value: "sShortsNeutral"
      }
    ]
  }
]

class ReactionDropdown extends Component {
  render() {
    return (
      <Select
        isMulti
        name="leftParticipants"
        value={this.props.leftParticipants}
        options={options}
        onChange={this.props.onChange}
      />
    )
  }
};

export default ReactionDropdown;
